import express from "express";
import dbConnection from "./db/connection/index";
import cors from "cors";
import { BASE_API_PORT } from "./constants/CONSTANTS";

import blogroute from "./routes/index";

const startServer = async () => {
  await dbConnection()
    .then((result) => console.log(result))
    .catch((err) => console.log(err));
  const app = express();
  app.use(cors());
  app.use(express.json());
  app.use(blogroute);

  await new Promise((resolve) => app.listen({ port: BASE_API_PORT }, resolve));
  console.log(`🚀 server started at 4000`);
  return { app };
};
startServer();

