    db.on("error", () => {
      console.error.bind(console, "connection error:");
      reject(
        new Error(
          "Connection error has occurred when trying to connect to the database!"
        )
      );
    });
    db.once("open", () => resolve("🚀 Successful database connection."));
  });

export default dbConnection;

